import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Login from './Login';
// import MyPage from './MyPage';
// import SignUp from './SignUp';
// import Home from './Home';

function App() {
  return (
    <Router>
      <div className="flex flex-col items-center mt-10">
        <Link to="/" className="mb-4 px-4 py-2 bg-blue-500 text-white rounded-md">홈</Link>
        <Link to="/my-page" className="mb-4 px-4 py-2 bg-blue-500 text-white rounded-md">마이페이지</Link>
        <Link to="/login" className="mb-4 px-4 py-2 bg-blue-500 text-white rounded-md">로그인</Link>
        <Link to="/sign-up" className="px-4 py-2 bg-blue-500 text-white rounded-md">회원가입</Link>
      </div>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/my-page" element={<MyPage />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/sign-up" element={<SignUp />} />
      </Routes>
    </Router>
  );
}

export default App;
